import React from 'react';

export default function Dashboard({username,password}) {
  return(

    <div>


  <input className ="username" input type = "email" placeholder="enter your email" />
  <input classname ="password" input type = "password" placeholder='enter your password'></input>
  <button>Login</button>

        <h1 id='usernameLog'>{username}</h1>
        <h2 id="passwordLog">{password}</h2>


  </div>


  );
}
